let counter = sessionStorage.getItem('counter');
if (counter) {
	counter = JSON.parse(counter);
	updateCounter();
} else {
	fetch('https://api.fiammanda.workers.dev/').then(res => res.json()).then(res => {
		counter = res;
		sessionStorage.setItem('counter', JSON.stringify(counter));
		updateCounter();
	}).catch(error => console.error('[Failed to retreive counter] ' + error));
}

function updateCounter() {
	let page = counter[url];
	if (!page) {
		page = {like: 0, view: 1}
		fetch('https://api.fiammanda.workers.dev/register', {
			method: 'POST',
			body: JSON.stringify({
				url: url, title: title, pv: 1, uv: 1, like: 0
			})
		}).then(res => res.json()).then(res => {
			counter[url] = {
				id: res.objectId, like: 0, view: 1
			};
			sessionStorage.setItem('counter', JSON.stringify(counter));
		}).catch(error => console.error('[Failed to register counter] ' + error));
	} else {
		if (!sessionStorage.getItem(url)) {
			if (!localStorage.getItem(url)) {
				fetch(`https://api.fiammanda.workers.dev/visit/${page.id}`).then(res => res.json()).then(res => {
					counter[url].view += 1;
					sessionStorage.setItem('counter', JSON.stringify(counter));
					sessionStorage.setItem(url, '1');
					localStorage.setItem(url, '1');
				}).catch(error => console.error('[Failed to update UV] ' + error));
			} else {
				fetch(`https://api.fiammanda.workers.dev/view/${page.id}`).then(res => res.json()).then(res => {
					counter[url].view += 1;
					sessionStorage.setItem('counter', JSON.stringify(counter));
					sessionStorage.setItem(url, '1');
				}).catch(error => console.error('[Failed to update PV] ' + error));
			}
		}
	}

	if (layout.indexOf('weblog-') === 0 || layout.indexOf('works-') === 0) {
		let articles = document.querySelectorAll('article');
		articles.forEach(article => {
			if (article.querySelector('h1 a')) {
				let href = article.querySelector('h1 a').pathname,
				    view = article.querySelector('header .view'),
				    like = article.querySelector('header .like');
				if (counter[href]) {
					view.append(counter[href].view);
					like.append(counter[href].like);
				} else {
					view.append(0);
					like.append(0);
				}
				view.classList.remove('off');
				like.classList.remove('off');
			}
		});
	}
	if (layout === 'weblog' || layout === 'works') {
		const textarea = document.createElement('textarea');
		      view = $('article header .view'),
			  like = $('article header .like'),
		   comment = document.querySelector('[itemprop="comment"]'),
		      list = comment.querySelector('ul'),
		      form = comment.querySelector('form'),
		      text = form.querySelector('textarea'),
		     quote = form.querySelector('article'),
		    submit = {title: title, url: url};
		let comments = [];
		view.append(page.view).attr({
			'data-prev': page.view-1,
			'data-next': page.view,
		}).removeClass('off').addClass('on');
		if (localStorage.getItem(url) === '2') {
			like.attr({
				'data-prev': page.like-1,
				'data-next': page.like,
			}).addClass('on');
		} else {
			like.attr({
				'data-prev': page.like,
				'data-next': page.like+1,
			})
		}
		like.removeClass('off').on('click', function() {
			if (localStorage.getItem(url) !== '2') {
				fetch(`https://api.fiammanda.workers.dev/like/${page.id}`).then(res => res.json()).then(res => {
					counter[url].like += 1;
					sessionStorage.setItem('counter', JSON.stringify(counter));
					localStorage.setItem(url, '2');
					like.addClass('on');
				}).catch(error => console.log('[Failed to update likes]: ' + error));
			} else {
				fetch(`https://api.fiammanda.workers.dev/unlike/${page.id}`).then(res => res.json()).then(res => {
					counter[url].like -= 1;
					sessionStorage.setItem('counter', JSON.stringify(counter));
				}).catch(error => console.log('[Failed to update likes]: ' + error));
				localStorage.setItem(url, '1');
				like.removeClass('on');
			}
		});
		textarea.style.width = text.offsetWidth + 'px';
		textarea.style.position = 'absolute';
		textarea.style.padding = '1em';
		textarea.style.pointerEvents = 'none';
		textarea.style.opacity = 0;
		document.body.appendChild(textarea);
		$(text).on('input', function() {
			debounce(() => {
				textarea.value = this.value;
				this.style.height = textarea.scrollHeight + 'px';
			}, 200);
		});
		$(comment).on('click', 'header', function() {
			comment.removeAttribute('style');
			comment.firstElementChild.removeAttribute('class');
			text.focus();
			fetch(`https://api.fiammanda.workers.dev/comments${url}`).then(res => res.json()).then(res => {
				comments = res;
				comments.forEach(item => updateComment(item));
				comment.removeAttribute('class');
			}).catch(error => {
				console.log('[Failed to retreive comments]: ' + error);
				comment.style['max-height'] = '4rem';
				comment.style.overflow = 'hidden';
				comment.firstElementChild.className = 'on';
			});
		}).on('click', 'ul a[aria-label="reply"]', function() {
			let reply = this.parentNode.parentNode,
			      tid = this.previousSibling.dataset.tid,
			      rid = reply.parentNode.parentNode.dataset.id;
			if (submit.rid) {
				$(quote.parentNode).slideUp(200);
				setTimeout(function() {
					quote.innerHTML = reply.innerHTML;
					$(quote.parentNode).slideDown(200);
				}, 210);
			} else {
				quote.innerHTML = reply.innerHTML;
				$(quote.parentNode).slideDown(200);
			}
			submit.rid = rid;
			submit.tid = tid ? tid : rid;
			text.focus();
		}).on('click', 'form a[aria-label="reply"]', function() {
			delete submit.rid;
			delete submit.tid;
			$(quote.parentNode).slideUp(200);
		}).on('click', 'a[aria-label="enter"]', function() {
			form.className = 'off';
			submit.name = comment.querySelector('input[name="name"]').value;
			submit.mail = comment.querySelector('input[name="mail"]').value;
			submit.link = comment.querySelector('input[name="link"]').value;
			submit.text = spaced(text.value);
			if (!submit.link) {
				delete submit.link;
			}
			fetch('https://api.fiammanda.workers.dev/comment', {
				method: 'POST',
				body: JSON.stringify(submit)
			}).then(res => res.json()).then(res => {
				console.log(JSON.stringify(res))
				submit.objectId = res.objectId;
				submit.time = res.createdAt;
				comments.push(submit);
				updateComment(submit, true);
				form.removeAttribute('class');
				text.removeAttribute('style');
				text.value = '';
				$(quote.parentNode).slideUp(200);
				delete submit.time;
			}).catch(error => console.log('[Failed to post the comment]: ' + error));
		}).on('click', 'a[data-rid]', function() {
			let reply = list.querySelector('li[data-id="' + this.dataset.rid + '"]');
			reply.className = 'on';
			setTimeout(function() { reply.removeAttribute('class'); }, 250);
		});

		function updateComment(item, update) {
			let li = `<li `;
			if (update) {
				li += `class="off" `;
			}
			li += `itemscope itemtype="https://schema.org/Comment" data-id="${item.objectId}"><article><span role="img">`;
			if (item.link === '/') {
				li += `${avatars[20]}</span><div>${convert(item.text)}<footer><a itemprop="author" class="internal" rel="home" href="/">${item.name}</a>`;
			} else if (item.link) {
				li += `${avatar(item.name)}</span><div>${convert(item.text)}<footer><a itemprop="author" target="_blank" rel="noopener noreferrer nofollow" href="${item.link}">${item.name} ${svg.link}`;
			} else {
				li += `${avatar(item.name)}</span><div>${convert(item.text)}<footer><a itemprop="author">${item.name}`;
			}
			li += `</a><time>${new Date(item.time).toLocaleString('sv-SE')}</time>`;
			if (item.tid) {
				li += `<a data-rid="${item.rid}" data-tid="${item.tid}">@ ${comments.find(x => x.objectId == item.rid).name}</a>`;
			}
			li += `<a aria-label="reply">${svg.plus}</a></footer></div></article><ul itemprop="comment"></ul></li>`;
			if (item.tid) {
				$(li).appendTo(list.querySelector(`li[data-id="${item.tid}"] ul[itemprop]`)).slideDown(200);
			} else {
				$(li).appendTo(list).slideDown(200);
			}
		}
		function avatar(name) {
			let code = now.getDate();
			for (let i = 0; i < name.length; i++) {
				code += name.charCodeAt(i);
			}
			return `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512">${avatars[code%20]}</svg>`;
		}
	}
}


